import React from "react";

import {Home} from './pages/Home'

import {Header} from './components';
import { Route, Routes } from "react-router";






function App() {

  return (
      <div className="wrapper">
      <Header />
      <div className="content">   
      <Link to="/">Home</Link>

      <Routes>
        <Route path="/pages/Home" element={<Home/>}
        /> 
      </Routes>
    </div>
  </div>
  );
}

export default App;
